        <div className="slide" id="slide1"><img data-src="holder.js/100%x100%/auto/sky/text:slide 1" /></div>
        <div className="slide" id="slide2"><img data-src="holder.js/100%x100%/auto/vine/text:slide 2" /></div>
        <div className="slide" id="slide3"><img data-src="holder.js/100%x100%/auto/lava/text:slide 3" /></div>
        <div className="slide" id="slide4"><img data-src="holder.js/100%x100%/auto/grey/text:slide 4" /></div>
        <div className="slide" id="slide5"><img data-src="holder.js/100%x100%/auto/social/text:slide 5" /></div>
        <div className="slide" id="slide6"><img data-src="holder.js/100%x100%/auto/lava/text:slide 6" /></div>
    </div>
